import React, { useState, useEffect } from 'react'
import './index.css'
const App = () => {

  const [tiktok, settiktok] = useState()
const toggle = () => {
  settiktok(!tiktok)
}
  
  

  return (

    <div className='app'>

      <button
      onClick={toggle}
        className='btn'>
          {
            tiktok ? 'Follow' : 'Following'
          }
     
      </button>

    </div>
  )
}

export default App
